class Add{
	int add(int x, int y) {
		return x + y;
	}
	float add(float x, float y) {
		return x + y;
	}
	String add(String x, String y) {
		return x + y;
	}
	int add(int x, int y, int z) {
		return x+y+z;
	}
	float add(float x, float y, float z) {
		return x+y+z;
	}
	String add(String x, String y, String z) {
		return x + y + z;
	}
}